@sandbergja and I deployed to staging and did a QA on the UI. 
1. Search results is missing 'You searched for:'
2. 'Quick Links' are missing
3. Modal close button is not visible. This is an exisitng issue in production. The difference is: In production a user can close the modal when clicking outside of the modal or using the escape button. In the blacklight 8 PR only escape works.

@kevinreiss which of the above issues needs to be fixed in order to merge this PR? From our perspective 2 and 3 should be fixed as part of this PR.
